import React from 'react';
import './ContactPage.css'; // Файл для стилизации страницы контактов

const ContactPage = () => {
  return (
    <div className="contact-page">
      <h1>Свяжитесь с нами</h1>
      <div className="contact-info">
        <p><strong>Адрес:</strong> г. Москва, ул. Технологическая, д. 12, офис 34</p>
        <p><strong>Телефон:</strong> +7 (495) 123-45-67</p>
        <p><strong>Email:</strong> info@technosystem.ru</p>
        <p><strong>График работы:</strong> Пн-Пт: 09:00 - 18:00, Сб-Вс: выходной</p>
      </div>

      <h2>Оставьте заявку, и мы с вами свяжемся в ближайшее время</h2>

      <form className="contact-form">
        <label htmlFor="name">Ваше имя:</label>
        <input type="text" id="name" name="name" required />

        <label htmlFor="email">Ваш Email:</label>
        <input type="email" id="email" name="email" required />

        <label htmlFor="message">Сообщение:</label>
        <textarea id="message" name="message" rows="5" required></textarea>

      </form>
        <button type="submit" className="button">Отправить</button>
    </div>
  );
};

export default ContactPage;
